import './App.css';
import { Routes } from 'react-router-dom';
import MyPage from './pages/MyPage';
import Home from './pages/Home';

function App() {
  return (
	<>
		<Routes>
			<Route path="/" element={<Home />}></Route>
			<Route path="/mypage" element={<MyPage />}></Route>
		</Routes>
	</>
  );
}

export default App;
